import React from 'react'
import './mail.css'

const Mail = () => {
  return (
    <div className='mail_contain'>
        <h1 className='mail_title1'>Save time,save money</h1>
        <h2 className='mai_desc '>Sign to get best deal</h2>
    </div>
  )
}

export default Mail
